import styled from "styled-components";

export const Container = styled.div`
  text-align: center;

  min-width: 250px;
  height: 91.4vh;
  border: 1px solid #dedede;

  form {
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
  }
`;
